import { Routes, Route } from 'react-router-dom';
import ContextProvider from '../../utils/context/context';
import Login from '../Login/Login';
import Dashboard from '../Dashboard/Dashboard';
import useFetch from '../../utils/hooks/hook';

import './Home.css';

const Home = () => {
	// const userId = 12;
	const { data, loading, error } = useFetch('http://localhost:8080/user/:thing');
	console.log(
		'data : ',
		data,
		'\n=====================',
		'\nloading : ',
		loading,
		'\n=====================',
		'\nerror : ',
		error
	);

	return (
		<ContextProvider>
			<Routes>
				<Route path="/" element={<Login />} />

				<Route path="/user/:id" element={<Dashboard />} />
			</Routes>
		</ContextProvider>
	);
};

export default Home;
